        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa relativno moč lokalnih sil v primerjavi z globalnimi pri določanju položaja vozlišč in povezav. Postavitev vozlišč in povezav določa algoritem na podlagi sil. Algoritem poišče položaje vozlišč, ki niso preblizu, in povezave s približno enako dolžino.</p><p class\\="xis-paragraph">Na splošno večja vrednost za <span class\\="xis-windowItem">Moč sile</span> pomeni večjo razdaljo med vozlišči v omrežju.</p></section>',
