        "vaeua-gui-eua.barLabelFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Obravnava prekrivanja</span> določa dejanje, ki se izvede za prikaz oznak stolpcev, ko ni na voljo dovolj prostora za njihov prikaz in se prekrivajo.</p><div class\\="xis-paragraph">                      <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Samodejno</span></td><td>oznake prilagaja samodejno.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Brez</span></td><td>ne izvede obravnave prekrivanja.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Zmanjšajte število kategorij po meri, da odpravite naslednjo težavo. Če želite na primer odpraviti težave z nizko prioriteto, zmanjšajte število kategorij po meri v poročilu na 25 ali manj.</p><p class\\="xis-paragraph">Nizka prioriteta\\: vsebuje &gt; 25 kategorij po meri</p></section>',
