        "vaeua-gui-eua.Properties.partialdependence.numObs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa največje število zapisov za vzorec iz vhodnih podatkov, ki se uporabljajo za ustvarjanje napovedi modela, ki so prikazane v grafikonu delne odvisnosti.</p></section>',
