        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.predictorBins.help.tip.txt": "Več informacij o tej možnosti ",
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Vključuje neposredne povezave med posameznim vhodnim nevronom in posameznim ciljnim nevronom v omrežju.</p></section>',
        "vaeua-gui-eua.properties.sankey.compress.help.tip.txt": "Več informacij o tej možnosti ",
        "vaeua-gui-eua.Properties.factmac.learnStep.help.aria.txt": "Pomoč. Več informacij o tej možnosti ",
        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Prikaz vrednosti kljukice</span> določa metodo, ki se uporablja za postavitev vrednosti kljukic na os x. Izberete lahko <span class\\="xis-windowItem">Samodejno zmanjšaj prekrivanje</span> ali <span class\\="xis-windowItem">Nespremenljiva usmerjenost</span>.</p><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Samodejno zmanjšaj prekrivanje</span> se uporablja le, ko se vrednosti kljukic prekrivajo. Določite lahko naslednje\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Razporedi, odreži, spusti</span></td><td>izmenično premakne vrednosti navzgor in navzdol, izreže znake iz vrednosti kljukic in nato vrednosti kljukic spusti.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Zasukaj za 45°</span></td><td>vse vrednosti kljukic diagonalno zasuka za 45°.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Razporedi, odreži</span></td><td>izmenično premakne vrednosti kljukic navzgor in navzdol ter nato izreže znake iz vrednosti kljukic.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Odreži</span></td><td>izreže znake iz vrednosti kljukic.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Odreži, zasukaj za 45°</span></td><td>izreže znake iz vrednosti kljukic in diagonalno zasuka vse vrednosti kljukic za 45°.</td></tr></table></div>                 </div><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Nespremenljiva usmerjenost</span> se vedno uporablja in določa usmerjenost vrednosti. Določite lahko naslednje\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Vodoravno</span></td><td>prikaže vrednosti kljukic v vodoravni smeri.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Zasukaj za 45°</span></td><td>vse vrednosti kljukic diagonalno zasuka za 45°.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Zasukaj za 45°, spusti</span></td><td>vse vrednosti kljukic diagonalno zasuka za 45° in jih nato spusti.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.tip.txt": "Več informacij o tej možnosti ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Izvede hiter vzvratni izbor spremenljivk, da se ugotovi, katere spremenljivke so primerne za ustvarjanje modela. Upoštevajo se samo spremenljivke, katerih <span class\\="xis-userSuppliedValue">p</span>-vrednosti so nižje od določene stopnje pomembnosti.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Vaše poročilo potrebuje veliko časa, da naloži prvo stran. Če SAS Visual Analytics poleg dolgih časov nalaganja zazna druge težave z učinkovitostjo delovanja, najprej odpravite tiste težave. Če ne zazna drugih težav z učinkovitostjo delovanja, se obrnite na skrbnika, da ugotovite, ali na vaše poročilo vplivajo drugi dejavniki. Počasna povezava lahko na primer povzroči počasno nalaganje poročila.</p><p class\\="xis-paragraph">Nizka prioriteta\\: potrebuje &gt;\\= 5 sekund</p><p class\\="xis-paragraph">Srednja prioriteta\\: potrebuje &gt;\\= 10 sekund</p><p class\\="xis-paragraph">Visoka prioriteta\\: potrebuje &gt;\\= 25 sekund</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.aria.txt": "Pomoč. Več informacij o tej možnosti ",
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa aktivacijsko funkcijo, ki se uporablja za ustvarjanje izhodne plasti pri uporabi normalne porazdelitve za ustvarjanje modela za odziv. Eksponentna aktivacijska funkcija se uporablja z distribucijo gama ali Poissonovo distribucijo. </p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Vključite podatkovne elemente (dodelitve vlog, filtre itd.), povezane s shranjenim predmetom.</p></section>',
