        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruningRegTree.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa vrednost alfa za mero cene kompleksnosti, ki se uporablja za obrezovanje regresijskega drevesa. Večja vrednost alfa ustvari manjši drevesni diagram.</p></section>',
        "vaeua-gui-eua.usingTimeZones.help.tip.txt": "Kateri časovni pas lahko izberem za več datumov?",
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa, ali so besedilne povezave do te strani skrite za uporabnike, ki si je ne morejo ogledati. </p><p class\\="xis-paragraph">Če te možnosti ne omogočite, se uporabnikom, ki poskušajo stran, do katere nimajo dostopa, odpreti prek besedilne povezave, prikaže sporočilo obvestila.</p></section>',
        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.tip.txt": "Več informacij o tej možnosti ",
