        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useStopList.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa, ali se uporablja seznam nepomembnih besed. Seznam nepomembnih besed je preprosta zbirka besed z malo informacijami ali tujk, ki jih želite odstraniti iz besedila. Te besede morajo biti shranjene kot nabor podatkov SAS, ki je naložen v strežnik CAS.</p></section>',
        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.tip.txt": "Več informacij o tej možnosti ",
        "vaeua-gui-eua.Properties.neuralnetwork.annealingRate.help.aria.txt": "Pomoč. Več informacij o tej možnosti ",
