        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.includeMissing.help.aria.txt": "Pomoč. Več informacij o tej možnosti ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Uporablja privzeto število napovedovalcev za preskus za vsako razdelitev. Privzeta vrednost je skupno število napovedovalcev. Lahko pa določite število napovedovalcev za preskus pri vsaki razdelitvi.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Uporablja privzeto kazensko vrednost. Privzeta vrednost je 1,0.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageCount.help.aria.txt": "Pomoč. Več informacij o tej možnosti ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.missingAssignment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Če je število zapisov z manjkajočimi vrednostmi za kandidata napovedovalca večje ali enako najnižji določeni vrednosti, se manjkajoče vrednosti pri iskanju kandidatov razdelitve obravnavajo kot ločene vrednosti.</p></section>',
        "vaeua-gui-eua.barSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Razmik</span> določa razmik med stolpci.</p><p class\\="xis-paragraph">Za združene stolpce, ki so zbrani v gručo, se razmik prikaže med gručami. Znotraj gruče ni razmikov med posameznimi stolpci.</p></section>',
