        "vaeua-gui-eua.sas.van.ReportReview.HighCustomSortEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Zmanjšajte število vrednosti v razvrstitvah po meri, da odpravite naslednjo težavo. Če želite na primer odpraviti težave z nizko prioriteto, zmanjšajte število izbranih vrednosti v razvrstitvi po meri na 25 ali manj.</p><p class\\="xis-paragraph">Nizka prioriteta\\: vsebuje &gt; 25 razvrstitev</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelectionCriterion.help.tip.txt": "Več informacij o tej možnosti ",
