        "vaeua-gui-eua.Properties.generalizedAdditive.fConvValue.help.aria.txt": "Pomoč. Več informacij o tej možnosti ",
        "vaeua-gui-eua.Properties.predAuto.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Razširja analizo in vključuje zapise z manjkajočimi vrednostmi. Pri dejavnikih kategorije se manjkajoče vrednosti pri izvajanju analize obravnavajo na lastni ravni. Pri dejavnikih mere se manjkajoče vrednosti uporabljajo pri izračunu vrednosti pravila razdeljevanja. Ustvari se pravilo razdeljevanja, ki dodeli manjkajoče vrednosti veji, ki poveča vrednost razdelitve.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.auto_stop_method.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa kriterij za uporabo podatkov preverjanja veljavnosti za zaustavitev učenja pri lokalno najprimernejši iteraciji.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.learningRate.help.tip.txt": "Več informacij o tej možnosti ",
