        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določi začetno (privzeto) vrednost za kontrolnik. Začetna vrednost se izbere prvič, ko uporabnik odpre poročilo ali ko uporabnik izbere možnost <span class\\="xis-windowItem">Obnovi privzeto stanje poročila</span>. </p><div class\\="xis-paragraph">Vnesite vrednost v polje z besedilom ali določite eno naslednjih možnosti\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Samodejno</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Določi, da se vaša izbira shrani kot začetna vrednost, ko shranite poročilo. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Najnižja vrednost</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> Določi, da je najnižja vrednost v kontrolniku začetna vrednost.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Največja vrednost</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> Določi, da je največja vrednost v kontrolniku začetna vrednost.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">ime-paramtera</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Določa, da je vrednost izbranega parametra začetna vrednost za kontrolnik.</p><p class\\="xis-paraSimple">Parameter lahko izberete samo, če parameter z ustrezno vrsto podatkov že obstaja.</p></dd></dl></div>                 </div></section>',
