        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.aria.txt": "Pomoč. Več informacij o tej možnosti ",
        "vaeua-gui-eua.connectOrder.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Vrstni red povezovanja</span> določa, kako je treba povezati podatkovne točke, da se izoblikujejo črte grafikona. <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Os</span></td><td>poveže podatkovne točke na tak način, na katerega se pojavljajo od leve proti desni na osi x.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Podatki</span></td><td>poveže podatkovne točke v takem vrstnem redu, kot so prebrane iz vloge X.</td></tr></table></div>                 </div><p class\\="xis-paragraph">To vrednost lahko uporabite, da zagotovite povezovanje po vrstnem redu, ko vhodni podatki niso razvrščeni glede na vlogo X.</p></section>',
        "vaeua-gui-eua.Properties.svm.maxSupportVectors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa največje število podpornih vektorjev. Dejansko število podpornih vektorjev je lahko malo večje od navedenega števila zaradi narave metode množice aktivnih omejitev.</p></section>',
