        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.table.detailData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa, da podatki niso agregirani.</p><p class\\="xis-paragraph">Ta možnost je na voljo, ko uporabljate agregirane podatke, in velja za uvrstitve in filtre naknadnega združevanja. Ta možnost ni na voljo, če je za seznam v tabeli že uporabljen filter združevanja ali če je izbrana uvrstitev z določeno možnostjo <span class\\="xis-windowItem">Vse ostalo</span>.</p><p class\\="xis-paragraph">Seznam v tabeli, ki prikazuje podrobne podatke, ne more biti vir dejanja ali povezava.</p></section>',
