        "vaeua-gui-eua.sas.van.ReportReview.LowPercentageUsedColumns.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Odstranite neuporabljene stolpce v viru podatkov poročila, da odpravite naslednjo težavo. Če želite na primer odpraviti težave z nizko prioriteto, poskrbite, da poročilo uporablja najmanj 10&nbsp;% stolpcev v viru podatkov.</p><p class\\="xis-paragraph">Nizka prioriteta\\: uporablja &lt;\\= 10&nbsp;% stolpcev, če je v viru podatkov 100 ali več stolpcev.</p></section>',
        "vaeua-gui-eua.sas.van.Properties.object.title.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnosti samodejnega naslova morda ni mogoče uporabiti za nekatere predmete, kot je vrednost ključa.</p></section>',
        "vaeua-gui-eua.Properties.factmac.learnStep.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa velikost učnega koraka za algoritem stohastičnega gradientnega spusta. Počasnejše učenje lahko prepreči prekomerno prileganje modela. Vrednost koraka učenja se lahko prilagodi, da se zagotovi učinkovita konvergenca algoritma optimizacije.</p></section>',
