        "vaeua-gui-eua.Properties.svm.customPenaltyValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa kazensko vrednost, ki bo uporabljena. Na splošno večja vrednost pomeni manj podpornih vektorjev.</p></section>',
