        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Poskusi ustvariti drevesno povečano naivno Bayesovo mrežo, ki vključuje neposredno povezavo od pojasnjevalne spremenljivke do vsakega napovedovalca in drevesno strukturo napovedovalcev. Drevesno povečane naivne Bayesove mreže zahtevajo, da je minimalno število nadrejenih elementov vedno dva.</p></section>',
