        "vaeua-gui-eua.Properties.bayesNet.parentChild.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Poskusi ustvariti Bayesovo mrežo nadrejeni-podrejeni, ki razširja naivno Bayesovo mrežo. Ta razširitev napovedovalcem omogoča, da postanejo nadrejeni element pojasnjevalne spremenljivke, povezuje nadrejene in podrejene elemente pojasnjevalne spremenljivke in povezuje podrejene element pojasnjevalne spremenljivke.</p></section>',
