        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa globino podskupin percentilov, ki se uporabljajo za izračun nekaterih statistik. Te statistike vključujejo opazovano povprečje, dvig, kumulativni dvig, kumulativni odstotek zajetih in kumulativni odstotek dogodkov.</p></section>',
