        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Prikaz vrednosti kljukice</span> določa metodo, ki se uporablja za postavitev vrednosti kljukic na os x. Izberete lahko <span class\\="xis-windowItem">Samodejno zmanjšaj prekrivanje</span> ali <span class\\="xis-windowItem">Nespremenljiva usmerjenost</span>.</p><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Samodejno zmanjšaj prekrivanje</span> se uporablja le, ko se vrednosti kljukic prekrivajo. Določite lahko naslednje\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Spusti nekatere</span></td><td>spusti nekatere vrednosti kljukic.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Zasukaj za 45°</span></td><td>vse vrednosti kljukic diagonalno zasuka za 45°.</td></tr></table></div>                 </div><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Nespremenljiva usmerjenost</span> se vedno uporablja in določa usmerjenost vrednosti. Določite lahko naslednje\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Vodoravno</span></td><td>prikaže vrednosti kljukic v vodoravni smeri.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Zasukaj za 45°</span></td><td>vse vrednosti kljukic diagonalno zasuka za 45°.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Zasukaj za 45°, spusti</span></td><td>vse vrednosti kljukic diagonalno zasuka za 45° in jih nato spusti.</td></tr></table></div>                 </div></section>',
