        "vaeua-gui-eua.Properties.linearRegression.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Razširja model in vključuje zapise z manjkajočimi vrednostmi. Zvezni učinek je predlagan v okviru opazovanega povprečja in spremenljivke indikatorja, ki označuje podatkovno vrzel. Klasifikacijski učinek obravnava manjkajoče vrednosti kot ločeno raven. </p></section>',
