        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Prikaže najbolj ali najmanj priporočene kategorije za vsako spremenljivko kategorije. Dodeliti morate vsaj enega napovedovalca, preden lahko izberete napovedovalca.</p></section>',
