        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa število gruč za ustvarjanje oz. določa, da mora biti uporabljena metoda ABC (kriterij za poravnano polje), da je izpeljano optimalno število gruč.</p><p class\\="xis-paragraph">Metoda ABC najprej izbere število gruč za ustvarjanje, ustvari gruče in izračuna statistiko vrzeli za posamezno gručo. Nato se ustvari referenčna porazdelitev okrog posamezne gruče in izračuna se statistika vrzeli za posamezno referenčno distribucijo. Ta postopek se ponovi za vsa možna števila gruč. Število gruč, ki poveča skupno razliko med statistiko vrzeli za gruče in referenčnimi podatki, je izbrano kot optimalno število gruč.</p><p class\\="xis-paragraph">Metoda ABC je veljavna le, če so vsi vnosi spremenljivke mer.</p></section>',
