        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Uporablja privzeto število napovedovalcev za preskus za vsako razdelitev. Privzeta vrednost je kvadratni koren skupnega števila napovedovalcev. Lahko pa določite število napovedovalcev za preskus pri vsaki razdelitvi.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa število podskupin, ki se uporabljajo za kategorizacijo spremenljivk mere v grafikonu delne odvisnosti.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Omogoči hitri algoritem združevanja v gruče glede na k-povprečje in prezre razvrščanje v podskupine. Ne izberite te možnosti, če želite, da se uporabi iskanje s pohlepnim algoritmom in upošteva razvrščanje v podskupine. Nerazvrščeni odzivi mere kot kriterij izbire uporabljajo varianco. Ko je ta možnost izbrana, odzivi kategorije in v podskupine razvrščeni odzivi mere uporabljajo kriterij razmerja povečanja. V nasprotnem primeru se uporabi absolutno povečanje.</p></section>',
