        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.aria.txt": "Pomoč. Več informacij o tej možnosti ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Poskus ustvarjanje naivne Bayesove mreže in naivne Bayesove mreže s povečano Bayesovo mrežo. Naivna Bayesova mreža določa, da je pojasnjevalna spremenljivka edini nadrejeni element vseh napovedovalcev. Predvideva pogojno neodvisnost vseh napovedovalcev, ob upoštevanju pojasnjevalne spremenljivke. Naivna Bayesova mreža s povečano Bayesovo mrežo razširja naivno mrežo, pri čemer vozliščem napovedovalcev omogoča ustvarjanje Bayesove mreže.</p></section>',
