        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa raven prilagajanja, ki jo lahko posamezen uporabnik uporabi za svoj pogled poročila. Vsaka raven vključuje ravni pod njo.</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ustvari oznake HTML po meri, tako da lahko predmet ali poročilo vdelate v spletno stran.</p><p class\\="xis-paragraph">Če želite omogočiti oznake po meri na svoji spletni strani, morate v glavo strani dodati tudi oznake &lt;script&gt;. Za več informacij o vdelovanju vsebine storitve SAS Visual Analytics glejte naslednje\\: <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">Dokumentacija kompleta SDK v storitvi SAS Visual Analytics</a>.</p></section>',
        "vaeua-gui-eua.clusterSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Razmik med gručami</span> upravlja širino razmika med gručami za združene stolpce. Če želite spremeniti razmik med stolpci, navedite želeno vrednost v možnosti <span class\\="xis-windowItem">Razmik</span>.</p></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Vrsta skupine <span class\\="xis-windowItem">Razlikovalne vrednosti</span> je na voljo samo za mere z manjšim številom enoličnih vrednostih.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.responseBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa število podskupin, ki se uporabijo za kategorizacijo mere odziva.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.cellWeight.help.aria.txt": "Pomoč. Več informacij o tej možnosti ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ustvari odločitveno drevo, pri čemer uporabi podatke učenja in odločitveno drevo obreže z algoritmom cene kompleksnosti, ki ga uporabi za podatke preverjanja.</p></section>',
