        "vaeua-gui-eua.Properties.bayesNet.chooseBestNumParents.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ustvari določeno strukturo omrežja, pri čemer ponovi število nadrejenih elementov od 1 do najvišje vrednosti nadrejenih elementvov. Izbrano je omrežje z najboljšo stopnjo napačne klasifikacije.</p></section>',
        "vaeua-gui-eua.react.va.geo.search.pinLocation.help.tip.txt": "Več informacij o tej možnosti ",
