        "vaeua-gui-eua.Properties.predAuto.sensitivityToExtremeValues.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa stopnjo občutljivosti, ki se uporablja za določanje ekstremnih vrednosti. Pri višji vrednosti nastavitve občutljivosti se običajno določi več ekstremnih vrednosti.</p></section>',
