        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.maxLevels.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa največjo globino drevesa, pri katerem je korensko vozlišče ravni 1.</p></section>',
