        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določi začetno največjo vrednost (zgornja meja) za kontrolnik. Začetna vrednost se izbere prvič, ko uporabnik odpre poročilo ali ko uporabnik izbere možnost <span class\\="xis-windowItem">Obnovi privzeto stanje poročila</span>. </p><div class\\="xis-paragraph">Vnesite vrednost v polje z besedilom ali določite eno naslednjih možnosti\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Samodejno</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Določi, da se vaša izbira shrani kot začetna vrednost, ko shranite poročilo. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Največja vrednost</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Določi, da je največja vrednost v kontrolniku začetna vrednost.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">ime-paramtera</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Določa, da je vrednost izbranega parametra začetna vrednost za kontrolnik.</p><p class\\="xis-paraSimple">Parameter lahko izberete samo, če parameter z ustrezno vrsto podatkov že obstaja.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Pomoč. Več informacij o tej možnosti ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Določa način uporabe prometa za izračun časa potovanja za grafično funkcijo. Izberite eno od naslednjih možnosti\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Ne</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Določa, da se za izračun časa potovanja uporablja uravnoteženo povprečje preteklih podatkov o prometu za vse ure v dnevu in vse dni v tednu.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Trenutni promet</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Določa, da se za izračun časa potovanja uporabljajo trenutne prometne razmere. Te podatke o prometu lahko posodobite tako, da kliknete <span data-icon-name\\="refresh" alt\\="ikono za posodobitev podatkov o prometu" aria-label\\="ikono za posodobitev podatkov o prometu"></span>. Ko uporabnik prikaže poročilo, se promet ne posodobi samodejno. Uporabnik mora posodobiti podatke o prometu, da se prikažejo najnovejše prometne razmere.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Običajen promet</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> določa, da se za izračun časa potovanja uporablja običajni promet ob določeni uri in dnevu v tednu. Običajne prometne razmere temeljijo na zadnjih zgodovinskih podatkih.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Opomba\\:</span> Čas, ki ga določite, velja za lokalni čas za lokacijo na zemljevidu.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Opomba\\:</span>Pri pridobivanju podatkov o času potovanja se porabijo kreditne točke storitev Esri Premium.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Opomba\\:</span>Če za območje, ki vsebuje izračun časa potovanja, podatki o prometu niso na voljo, se za izračun časa potovanja uporabijo objavljene omejitve hitrosti.</div></section>',
