        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Izberite spremenljivko za razdelitev vozlišča. Spremenljivke so razvrščene po vrednosti logaritma, ki izmeri, kako dobro spremenljivka razdeli podatke. Vrednost logaritma je negativni logaritem p-vrednosti testa s hi-kvadratom.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Prikaže pregled osi.</p><p class\\="xis-paragraph">Ta možnost ni na voljo, če sta grafikonu dodeljena več kot dva podatkovna elementa.</p></section>',
