        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Odstranite kontrolnike iz območja poziva strani, da odstranite naslednjo težavo. Če želite na primer odpraviti težave s srednjo prioriteto, zmanjšajte število kontrolnikov v območju poziva strani na 10 ali manj.</p><p class\\="xis-paragraph">Srednja prioriteta\\: vsebuje &gt; 10 predmetov v območju poziva strani.</p></section>',
