        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Prilagodite postavitev poročila, da se izognete ugnezdenim vsebnikom in odpravite naslednje težave. Če želite na primer odpraviti težave z visoko prioriteto, poskrbite, da je v postavitvi poročila največ 6 ugnezdenih vsebnikov.</p><p class\\="xis-paragraph">Nizka prioriteta\\: vsebuje &gt; 2 ugnezdena vsebnika</p><p class\\="xis-paragraph">Srednja prioriteta\\: vsebuje &gt; 4 ugnezdene vsebnike</p><p class\\="xis-paragraph">Visoka prioriteta\\: vsebuje &gt; 6 ugnezdenih vsebnikov</p></section>',
