        "vaeua-gui-eua.Properties.neuralnetwork.annealingRate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Določa stopnjo ohlajanja, ki se uporablja za optimizacijo stohastičnega gradientnega spusta. Neničelna vrednost pripomore k temu, da model konvergira blizu lokalnega minimuma za ciljno funkcijo.</p></section>',
