        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Slog sukanja podatkovnega elementa</span> določa, kako so slogi dodeljeni podatkovnim elementom v predlogi grafikona. V črtnem grafikonu ta možnost na primer določa, kako se barve, vzorci črt in označbe uporabljajo za razlikovanje med črtami v grafikonu. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Samodejno</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">uporablja nastavitev sloga sukanja iz teme. Večina tem SAS uporablja nastavitev <span class\\="xis-windowItem">Najprej zasukaj vse barve</span>. Tema z velikim kontrastom uporablja nastavitev <span class\\="xis-windowItem">Zasukaj vse atribute</span>.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Najprej zasukaj vse barve</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">prikazuje neprosojno polnilo, neprosojno črto in usklajeno obliko označbe, dokler niso uporabljene vse barve v paleti.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Zasukaj vse atribute</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">prikazuje različne vzorce polnila, vzorce črt in oblike označb poleg različnih barv. Ta nastavitev lahko izboljša dostopnost za uporabnike s pomanjkanjem prepoznavanja barv (barvna slepota).</p></dd></dl></div>                 </div></section>',
