        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Možnost <span class\\="xis-windowItem">Merilo za združevanje</span> določi merilo za združene stolpčne grafikone. Stolpce je mogoče naložiti ali zbrati v gručo. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Dejanske vrednosti</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">določi velikost stolpcev glede na vrednosti v podatkih. Stolpec v eni skupini ima na primer vrednost 50, stolpec v drugi skupini pa vrednost 500. Stolpec z vrednostjo 500 bo bil torej 10-krat višji od stolpca z vrednostjo 50.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Normaliziraj skupine do vrednosti 100 %</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">predstavi skupine, pri tem se uporabi relativno merilo. Znotraj skupine je vsak stolpec prikazan kot odstotek skupine. Skupina ima na primer skupno vrednost 100. Če ima stolpec v tej skupini vrednost 50, bo vrednost višine tega stolpca znašala 50&nbsp;% glede na skupno vrednost višine v skupini.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Če predmet grafikona vsebuje elemente, ki se prekrivajo, ta možnost ni na voljo. Če za osi v mreži določite enak obseg podatkov, ta možnost ni na voljo.</p></section>',
