        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.slider.setFixedRange.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Omogoča vam, da določite možnosti <span class\\="xis-windowItem">Najmanjša vrednost</span> in <span class\\="xis-windowItem">Največja vrednost</span> za končne točke drsnika.</p><div class\\="xis-paragraph">Ta možnost ni na voljo, če je katera od spodnjih trditev pravilna\\: <div class\\="xis-listUnordered"><ul><li class\\="xis-item">za drsnik je določen filter ali uvrstitev,</li><li class\\="xis-item">drsnik je cilj dejanja filtra.</li></ul></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Opomba\\:</span>Če je omogočena možnost <span class\\="xis-windowItem">Upoštevaj združene podatke v filtriranih predmetih</span>, potem je ta možnost vedno omogočena.</div></section>',
